# The image file containing the grid
image = Image.open("emoji_grid.png")

# Use a counter to know which emoji from the list we're at
cpt = 0
for x in range(GRID_WIDTH):
    for y in (range(GRID_HEIGHT) if x < GRID_LAST_LINE_WIDTH else range(GRID_HEIGHT - 1)):
        # Crop the emoji
        cropped_img = image.crop((x * (EMOJI_SIZE + EMOJI_PADDING),
                                  y * (EMOJI_SIZE + EMOJI_PADDING),
                                  x * (EMOJI_SIZE + EMOJI_PADDING) + EMOJI_SIZE,
                                  y * (EMOJI_SIZE + EMOJI_PADDING) + EMOJI_SIZE))
        # Save the emoji
        cropped_img.save("../emojis/" + emoji_codes[cpt] + ".png")
        cpt += 1
